(function ($, Drupal) {
  Drupal.behaviors.bannerSlider = {
    attach: function (context, settings) {
        $(function(){
            $('html', context).once('banners-slider').each(function () {

                var slides = $('.slide')
                var sliderContent = $('.slider-content')
                var slideW = $('.slide').outerWidth()
                var inView = Math.floor(sliderContent.outerWidth() / slideW + 0.1) // Math.floor(x + 0.1) is used to get intager instead of float 
                var animatable = inView < slides.length

                if(!animatable){
                    $('.banners-slider').addClass('static')
                }
            
                function setInitPos(setButtons){
                    var left = 0
                    slides.each(function(i){    
                        $(this).css('left',left)
                        left += $(this).outerWidth()
                        if(setButtons){
                            $('.slider-buttons').append('<div class="slider-button ' + (i == 0 ? 'active ':'') + '"></div>')
                        }
                    })
                    
                }
            
                var posNow = 0
                var animTime = 300
                var dif
                var c = 0  //index for curently animated element
                var c2 = 0  //index for curently completed animation of element
                var slidesMovedBefore = 0
                var setSlidesPosition = true
                var autoSlideTime = drupalSettings.banners_slide_interval
            
                function moveSliderTo(pos){
            
                    if(animatable){
                        animatable = false

                        // pos represents index of target slide,
                        dif = pos - posNow
                        var left = 0
                        slideW = $('.slide').outerWidth()
                        difPx = -dif * slideW

                        slides.animate({'left': '+='+difPx+''}, {
                            step: function(n,t){    //step gets executed for evry animated element, so c couts to slides.lenght to ecexute position checks once per element loop, and falow witch slide is geting animated  
                                if(c == slides.length && pos != posNow){ //for some reason if(c == slides.length) might get executed twice in element loop,  so "pos != posNow" is thete to prevent it
                                    
                                    c = 0
                                    
                                    slidesMovedNow = (t.start - t.now) / slideW
                                    slidesMovedNow = Math.floor(slidesMovedNow + 0.1)
                                    
                                    if(slidesMovedNow != slidesMovedBefore){    // if slides have moved by one slide lenght, asign for reposition final or first slide, depending on movement direction

                                        slidesMovedBefore = slidesMovedNow 
                                        setSlidesPosition = posNow + slidesMovedNow - (dif > 0 ? 1 : 0)
                                        setSlidesPosition = setSlidesPosition < 0 ? slides.length + setSlidesPosition : setSlidesPosition
            
                                    }
                                }
                                
                                if(setSlidesPosition === c){//if curently animated elements index "c" equals to element asigned for repositon, modify animation tween to reposition slide
                                    
                                    dir = dif > 0 ? 1 : -1  
                                    
                                    t.end += slideW * (slides.length) * dir
                                    t.now += slideW * (slides.length) * dir
                                    t.start += slideW * (slides.length) * dir
                                
                                    setSlidesPosition = false
                                    
                                }

                                c++
                            },

                            start:function(){
                                c = 0
                            },

                            complete:function(){
                                
                                if(c2 == slides.length - 1 ){
                                    slidesMovedBefore = 0
                                    c2 = 0
                                    posNow = pos
                                    
            
                                    if(posNow > slides.length - 1){
                                        posNow -= slides.length
                                    }
                                    if(posNow < 0){
                                        posNow += slides.length
                                    }
                                    if(posNow==0){
                                        setInitPos()
                                    }
                                    animatable = true
                                    $('.slider-button').removeClass('active')
                                    $('.slider-button').eq(posNow).addClass('active')
                                    
                                    setBannertTimeout()
                                }
                                c2++
                            },
                            duration: animTime
                        })
                    }
                
                }
            
                function resizeBanner(){
                    slideW = $('.slide').outerWidth()
                    inView = Math.floor(sliderContent.outerWidth() / slideW + 0.1) // Math.floor(x + 0.1) is used to get intager instead of float 
                    posNow = 0
                    animatable = inView < slides.length
                    
                    if(!animatable){
                        $('.banners-slider').addClass('static')
                    }else{
                        $('.banners-slider').removeClass('static')
                    }

                    $('.slider-button').removeClass('active')
                    $('.slider-button').eq(posNow).addClass('active')
                    setInitPos(false)
                }
            
                var resizeTimer
                
                $(window).resize(function(){
                    clearTimeout(resizeTimer)
                    resizeTimer = setTimeout(function(){
                        resizeBanner()
                    },200)
                })
                
                $('.slider-control').click(function(){
                    moveSliderTo(posNow+parseInt($(this).attr('control-dir')))
                })
            
                $('.slider-buttons').on('click', '.slider-button',function(){
                    moveSliderTo($(this).index())
                })
            
                setInitPos(true)

                var bannerTimeout

                function setBannertTimeout(){
                    window.clearTimeout(bannerTimeout)
                    bannerTimeout = setTimeout(function(){
                        if (document.hasFocus()){
                            moveSliderTo(posNow + 1)
                        }else{
                            setBannertTimeout()
                        }
                        },autoSlideTime)
                }
                setBannertTimeout()

            });
        })
    
    }
  };
})(jQuery, Drupal);
