(function ($, Drupal) {
  Drupal.behaviors.audioPlayer = {
    attach: function (context, settings) {
      var that = this;

      $('html', context).once('audioPlayer').each(function() {
        that.activateAudioPlayer(that, 'standart');
      });

      $('html', context).once('audioPlayerReopen').each(function() {
        var reopenBtn = jQuery('.reopen-cookies');
        if (reopenBtn.length) {
          reopenBtn.on('click', function() {
            that.activateAudioPlayer(that, 'reopen');
          })
        }
      })
      $('html', context).once('audioPlayerShareReopen').each(function() {
        var reopenBtn = jQuery('.sidebar-content .content-tools-row.share');
        if (reopenBtn.length) {
          reopenBtn.on('click', function() {
            that.activateAudioPlayer(that, 'reopen-share');
          })
        }
      })
    },
    activateAudioPlayer: function(that, type){
        setTimeout(function(){
          $('.audio-player-block').each(function(index, element) {
            var thisPlayer = $(this);
            thisPlayer.attr('id', 'audio-player-block-'+ type + index)

            // Initialize audio players.
            GreenAudioPlayer.init({
              selector: '#audio-player-block-'+ type + index,
              stopOthersOnPlay: true,
              showDownloadButton: true,
              enableKeystrokes: true
            });

            // Move time fields to player end.
            var currentTime = thisPlayer.find('.controls__current-time');
            var totalTime = thisPlayer.find('.controls__total-time');
            var timeBlock = thisPlayer.find('.time-block');
            var playbackBlock = thisPlayer.find('.playback-block');
            var playbackButton = thisPlayer.find('.playback-btn');
            var playbackOptions = thisPlayer.find('.playback-speed');
            var audio = thisPlayer.find('audio')[0];

            playbackBlock.insertAfter(thisPlayer.find('.volume'))

            const options = [0.25, 0.5, 0.75, 1, 1.25, 1.5, 1.75, 2];

            options.forEach(function(element) {
              const input = $('<input>').attr({
                type: 'radio',
                name: 'speed',
                id: element + 'x',
                value: element
              })

              if (element == 1) {
                input.prop('checked', true)
              }

              input.appendTo(playbackOptions);

              $('<label>').attr({
                for: element + 'x',
                tabindex: 0,
                class: 'audio-speed-label'
              }).text(element == 1 ? 'Standarta' : element + 'x').appendTo(playbackOptions);
            })

            playbackButton.on('click', function (e) {
              e.stopPropagation()
              $(this).toggleClass("active");
            })

            $(document).on('click', function () {
              playbackButton.removeClass("active");
            })

            playbackOptions.find('input').on('change', function () {
              const value = $(this).val();
              audio.playbackRate = value;
            })
            playbackOptions.find('label').on('keypress', function () {
              const forvalue = $(this).attr('for');
              $('#audio-player-block-'+ type + index+' .playback-speed input[id="'+forvalue+'"]').prop('checked', true);
              const value = $('#audio-player-block-'+ type + index+' .playback-speed input[id="'+forvalue+'"]').val();
              audio.playbackRate = value;
              playbackButton.removeClass("active");
            })

            currentTime.appendTo(timeBlock);
            $('<span class="splitter">/</span>').appendTo(timeBlock);
            totalTime.appendTo(timeBlock);

            // Add class if player has used.
            thisPlayer.find('.play-pause-btn').on('click', function () {
              var progressBar = thisPlayer.find('.controls .gap-progress');

              // Use "has-played" class to always show progress pin if paly button is pressed atleast once.
              if (!progressBar.hasClass('has-played')) {
                progressBar.addClass('has-played');
              }
            });

            that.setButtonsEvents('#audio-player-block-'+ type + index);
          });
        })
    },
    setButtonsEvents: function(selector) {

        // Add tabindex to buttons and "Enter" button keypress for accessibility.
        $(selector+' .holder').attr('tabindex', '0').on('keypress', function (e) {
          if (e.which == 13) {
            $(selector+' .play-pause-btn').trigger('click');
          }
        });

        $(selector+' .volume').attr('tabindex', '0').on('keypress', function (e) {
          if (e.which == 13) {
            $(selector+' .volume__button').trigger('click');
          }
        });

        $(selector+' .download').attr('tabindex', '0').on('keypress', function (e) {
          if (e.which == 13) {
            // Has to download manually because jQuery can not trigger library events.
            var src = $(selector+' audio source').attr('src');
            var name = src.split('/').reverse()[0];
            var file = new File([src], name);
            var link = document.createElement('a');

            link.download = file.name;
            link.href = file;
            link.click();
          }
        });
        jQuery(selector+' .audio-speed-label[for="2x"]').on('blur', function () {
          jQuery(selector+' .playback-btn').removeClass('active');
        });
        jQuery(selector+' .volume__slider.slider').on('blur', function () {
          jQuery(selector+' .volume__button').click();
        });
    }
  }
})(jQuery, Drupal);
;
(function ($, Drupal) {
    Drupal.behaviors.tvp_contacts = {
        attach: function (context, settings) {

            let isMobile = (window.innerWidth < 768);

            function manageBreadCrumbs(optionTitle, optionId) {
                var textForBreadCrumbs = optionTitle[0].innerHTML;
                var allItems = [];

                $('#structure-breadcrumbs').append("<div class='structure-breadcrumb-item' id='" + optionId + "'>" + textForBreadCrumbs + "</div>");

                $.each($('.structure-breadcrumb-item'), function () {
                    allItems.push(this);

                    // With each breadcrumb item we will track previous item margin-left
                    // and add +20 each time. We need to remove -20 for the first item element (no margin-left)
                    $(this).css('marginLeft', (allItems.length * 20) - 20);
                });
            }

            $(document).delegate('.structure-breadcrumb-item', 'click', function (event) {
                event.stopPropagation();

                $(this).nextAll(".structure-breadcrumb-item").remove();

                var getSelectedItemUl = $('.department-content-block > .structure-menu > ul').find('ul#' + $(this).attr('id'));
                if (getSelectedItemUl[0]){
                    cloneMenu(getSelectedItemUl, false, $(this).attr('id'));
                }
            });

            function cloneMenu(menu_element, init, breadcrumb_id) {
                var menuClone = $(menu_element).clone();

                if (init) {
                    $('#structure-menu-mob').html(menuClone);
                } else {
                    $('#structure-menu-mob').html('<div class="structure-menu"><ul>' + menuClone.html() + '</ul></div>');
                }

                if (breadcrumb_id) {
                    $('.department-info').html($('.department-info-' + breadcrumb_id).html());
                    $('.department-boss').replaceWith($('.department-info').css('display', 'block'));
                }

                $('#structure-menu-mob li').on('click', function (event) {
                    event.stopPropagation();

                    var cloneParentUl = $(this).find('ul');
                    var grabTitleForBreadCrumbs = $(this).children('.anchor');
                    var grabIdForBreadCrumbs = $(this).attr('id');

                    if (cloneParentUl.length > 0) {
                        cloneMenu(cloneParentUl);
                    } else {
                        $('.department-content-block > #structure-menu-mob').html('');
                    }

                    var infoId = $(this).attr('id');
                    $('.department-info').html($('.department-info-' + infoId).html());

                    $('.department-boss').replaceWith($('.department-info').css('display', 'block'));
                    $('.department-content-block').removeClass("row");
                    manageBreadCrumbs(grabTitleForBreadCrumbs, grabIdForBreadCrumbs);
                });
            }
            jQuery(document).delegate('.structure-menu > ul > li.main-tree-item > span.anchor', 'click', function () {
                //when clicked on main menu item, if it has no child, no department info shoud be seen
                jQuery('.department-info').html('');
            });

            jQuery(document).delegate('.structure-menu > ul li.tree-item > span.anchor', 'click', function () {
                var infoId = $(this).parent('li').attr('id');

                jQuery('.department-info').html('');

                if (infoId) {
                    if (!isMobile) {
                        $('[class^="department-info-"]').css({
                            display: 'none'
                        });
                    }

                    $('.department-info').html($('.department-info-' + infoId).html());

                    if (!isMobile) {
                        $('.department-info-' + infoId).css({
                            display: 'block'
                        });
                    }
                }
            });
            let initaialState = $('.department-boss').clone()
            $('.type-department #header-info .display-4').on('click', function(){
                if(isMobile){
                    cloneMenu('#parent-level', false);
                    $('.department-info').html( initaialState )
                    Drupal.behaviors.spamspan.attach()
                    $('#structure-breadcrumbs').html('')
                }

            })

            if (isMobile) {
                $('#structure-menu-mob').css('display', 'block');
                cloneMenu('.structure-menu', true);
                $('.department-content-block > .structure-menu').hide();
            }

            if (!isMobile) {
                $(".structure-menu li.tree-item span.anchor").on('click', function (event) {
                    let element = $(this).parent('li.tree-item');
                    if (!element.hasClass("active")) {
                        var infoId = element.attr('id');
                        $('.department-info').html($('.department-info-' + infoId).html());

                        var depHeight = $('.department-info-' + infoId).height();
                        $(".structure-menu ul").each(function () {
                            if ($(this).css('display') == 'block') {
                                if ($(this).height() < depHeight) {
                                    $(this).css('height', depHeight);
                                }
                            }
                        });
                    }
                });

                $(document).delegate('.structure-menu li.tree-item span.anchor', 'click', function (event) {
                    event.stopPropagation();

                    if (!isMobile) {
                        $('.scrollbar-inner').scrollbar();
                    }

                    var totalWidth = 0;
                    var parentHeight = $('.structure-menu ul#parent-level').height();
                    var maxHeight = 0;
                    var clickedLiElement = $(this).parent('li.tree-item');

                    if ($(clickedLiElement).children('ul')) {
                        var childrenList = clickedLiElement.children('ul');
                        var childrenListHeight = childrenList.height();

                        if (!clickedLiElement.hasClass('active')) {
                            if (childrenListHeight > parentHeight && childrenListHeight > maxHeight) {
                                maxHeight = childrenListHeight;
                            }
                        }
                    }

                    $(clickedLiElement).addClass('active');

                    $('li', '.structure-menu')
                        .not(clickedLiElement
                        ).not(clickedLiElement.parents('li', '.structure-menu'))
                        .removeClass('active');


                    $(".structure-menu ul").each(function () {
                        var isVisible = $(this).css('display');
                        if (isVisible == 'block') {
                            totalWidth += $(this).width();
                        }
                    });

                    $('.department-info').css('left', totalWidth + 30);

                    if (!isMobile) {
                        var infoId = $(this).parent('li').attr('id');
                        var $data_element = $('.department-info-' + infoId);
                        var data_offset = $data_element.offset();
                        var data_position = $data_element.position();
                        var department_info_offset = $('.department-info').offset();

                        $data_element.css({
                            left: department_info_offset.left - data_offset.left + data_position.left
                        });
                    }

                    $(".structure-menu ul").each(function () {
                        if ($(this).css('display') == 'block') {
                            $(this).css('height', maxHeight === 0 ? parentHeight : maxHeight);
                        }
                    });

                    var scrollableArea = $('.department-content-block').get(0).scrollWidth;
                    $('.scrollbar-inner').scrollLeft(scrollableArea);

                });

                $('.font-size-block .block-btn').click(function(){
                    //timeout is set to 
                    setTimeout(function(){                        
                        $('div[class*=department-info]').css('left',  $(".structure-menu ul").last().width() + 30  + 'px');

                    },600)
                })
                
            }
        }
    };
        Drupal.behaviors.emailFormat = {
        attach:function(context, settings){
            
            setTimeout(function(){
                $('.email-button').each(function(){
                    $(this).attr('aria-label', $(this).siblings('a.spamspan').attr('aria-label'))
                    $(this).tooltip({
                        title:$(this).siblings('a.spamspan').text(),
                        template: '<div class="tooltip email-tooltip file-large-tooltip" role="tooltip"><div class="arrow"></div><div class="tooltip-inner"></div></div>'
                    })
                    $(this).click(function(){
                        $(this).siblings('a.spamspan')[0].click()
                    })
                    
                    $(this).siblings('.email-copy').tooltip({
                        title: Drupal.t('Copy'),
                        template: '<div class="tooltip email-tooltip file-large-tooltip" role="tooltip"><div class="arrow"></div><div class="tooltip-inner"></div></div>'
                    })
                    $(this).siblings('.email-copy').attr('data', $(this).siblings('a.spamspan').text())
                    $(this).siblings('.email-copy').click(function(){
                        var input = document.createElement('input')
                        input.type = 'text'
                        input.value = $(this).siblings('a.spamspan').text()
                        input.style.position = 'absolute'
                        input.style.left = '0px'
                        input.style.top = '0px'
                        $('body')[0].append(input)
                        input.select();
                        input.setSelectionRange(0, 99999)
                        document.execCommand("copy");
                        $(input).remove()
                        
                        $(this).tooltip( "dispose")
                        $(this).tooltip( {
                            title: Drupal.t('Copied'),
                            template: '<div class="tooltip email-tooltip copied-tooltip file-large-tooltip" role="tooltip"><div class="arrow"></div><div class="tooltip-inner"></div></div>'
                        })
                        $(this).tooltip( "show")

                        // .tooltip( "option", "content", "Awesome title!" );
                    })
                })
            }, 500)
            
        }
    }
})(jQuery, Drupal);
;
(function ($, Drupal) {
  Drupal.behaviors.contentToolsBlock = {
    attach: function (context, settings) {

      $('body', context).once('content-tools-block-rendered').each(function () {

        // Print button functionality
        $('.content-tools-row.print', context).on('click', function(e){
          e.preventDefault();
          window.print();
        });

        // Share block functionality
        $('.content-tools-block .share', context).on('click', function(e){
          e.preventDefault();

          if( !$('body').hasClass('modal-popup-overlay-opened') && typeof a2a !== 'undefined' ){
            $('.modal-popup-overlay .modal-popup-content').html($('#share-modal-popup-content').html());
            a2a.init_all();
            $('body').addClass('modal-popup-overlay-opened');
            setTimeout(function(){
              $('.modal-popup-content-wrap .share-btns .modal-elements:first').focus();
            })
          }
          jQuery('.modal-popup-overlay .share-btns a').addClass('modal-elements');
          e.preventDefault();
        });
        jQuery('.content-tools-block .share a').on('click', function(e){
          jQuery('.content-tools-block .share').tooltip( "hide")
        })
        $('.content-tools-share-content .close, .content-tools-share-content .cancel-share a', context).on('click', function(e){
          e.preventDefault();
          if( $('body').hasClass('content-tools-share-opened') ){
            $('body').removeClass('content-tools-share-opened');
          }
        });
        $('.content-tools-share .content-tools-share-content .share-btns > span > a', context).on('click', function(e){
          setTimeout(function(){
            if( $('body').hasClass('content-tools-share-opened') ){
              $('body').removeClass('content-tools-share-opened');
            }
          }, 500);
        });

      });

    }
  };
})(jQuery, Drupal);
;
